import { React, useState } from "react";
import "./Registracija.css";

const Registracija = () => {
  const [kime, setKime] = useState();

  return (
    <form>
      <label>
        Korisničko ime:
        <input
          type="text"
          name="kime"
          placeholder="Korisničko ime"
          id="kime"
          value={kime}
          onChange={setKime}
        />
      </label>
      <label>
        Ime:
        <input type="text" name="ime" placeholder="ime" id="ime" />
      </label>
      <label>
        Prezime:
        <input type="text" name="prezime" placeholder="Prezime" id="prezime" />
      </label>
      <label>
        Lozinka:
        <input type="text" name="lozinka" placeholder="Lozinka" id="lozinka" />
      </label>
      <input type="submit" value="Submit" />
    </form>
  );
};

export default Registracija;
